import React,{ useState,useEffect} from 'react'
import './Flight.css'
import Axios from "axios";

const Flight = () => {

 const[allflights,setAllflights]=useState([])

  useEffect(() =>{
    Axios.get("http://localhost:3001/searchByAirport/:Airport").then((Response)=> {
      setAllflights(Response.data)
    })
  
  },[]);

  return (<div className="table_of_flights">
    <h1> Flights</h1>
    <table>
      <thread>
     <tr>
       <th>flight Name</th>
       <th>Departure Date</th>
       <th>Departure time</th>
       <th>Departure Airport</th>
       
       </tr>
    </thread>

   {allflights.map((val,key)=>{
     return (<div> 
       <h1>{val.Flight_Number }</h1> 
       <h1>{val.Departure_Date} </h1> 
       <h1>{val.Departure_Time }</h1>
       <h1>{val.Departure_Airport} </h1>  
       </div>
       )
   })}
  </table>
  </div>
  )
}

export default Flight
